import React from "react";
// @ts-ignore
import styles from "./App.module.css";

const Button = ({ title, onClick, className }: any) => {
    // const onClick = () => {};
    // const title = "Push";

    return (
        <div
            onClick={onClick}
            className={`${styles.button} ${styles.pinkButton}`}
        >
            {title}
        </div>
    );
};

export const App = () => {
    return (
        <div className={styles.app}>
            <Button
                title={"Push"}
                onClick={() => alert("Narzal")}
                className={styles.pinkButton}
            />
            ;
        </div>
    );
};

export default App;
